import { useState } from 'react';
import './App.css';
import Login from './components/Login';

function App() {

  const [l, setL] = useState(false);

  const Login = ()=>{
    setL(true);
  }

  return (
    <div className="App">
      <div className="home">
        <h1>Welcome !!!</h1>
        <h3 onClick={Login}>Login here</h3>
        <Login login={l}/>
      </div>
    </div>
  );
}

export default App;
